import * as React from "react";
import Box from "@mui/material/Box";
import DataTable from "./table";
import Sidebar from "../../shared/layout/Sidebar";
import Header from "../../shared/layout/Header";

function Dashboard() {
  return (
    <Box sx={{ display: "flex" }}>
      <Sidebar />
      <Box>
        <Header />
        <Box>
          <DataTable />
        </Box>
      </Box>
    </Box>
  );
}

export default Dashboard;
